INSERT INTO `avisos` (`id_aviso`, `titulo`, `categoria`, `imagen_destacada`, `contenido`, `id_creador`, `fecha_publicacion`, `es_activo`, `fecha_actualizacion`) VALUES
(12, 'DÍA DE LA ESPECIALIDAD DE ARSENALES', 'General', 'aviso_1763671940_691f7f8493483.png', '<h2>DIA DE LA ESPECIALIDAD DE ARSENALES \"SAN MARTIN DE TOURS\"</h2>\r\n<h3>FELIZ DIA A TODOS LOS CAMARADAS DE LA ESPECIALIDAD DE ARSENALES</h3>\r\n<p>&nbsp;</p>\r\n<p>En el d&iacute;a en que la Especialidad de Arsenales festeja el aniversario de su creaci&oacute;n y celebra a su patrono, San Mart&iacute;n de Tours, hacemos llegar nuestros saludos a todos los integrantes.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Breve Rese&ntilde;a Hist&oacute;rica del Comando de Arsenales</strong></p>\r\n<p>La Especialidad de Arsenales naci&oacute; con los albores de la Patria, por cuanto antes de estallar la Revoluci&oacute;n de Mayo, en el Virreinato del R&iacute;o de la Plata solamente exist&iacute;a la \"Armer&iacute;a Real\" en la que revistaban un maestro mayor de armer&iacute;a, ocho oficiales y peones, que apenas funcionaba como dep&oacute;sito y lugar de mantenimiento pero sin capacidad de producci&oacute;n; y el \"Parque de Artiller&iacute;a\" que almacenaba los ca&ntilde;ones, obuses y morteros que se encontraban fuera de servicio.</p>\r\n<p>Por el a&ntilde;o 1806, antes de las Invasiones Inglesas, existi&oacute; en Buenos Aires el Cuerpo de Maestranza de Artiller&iacute;a, dividido en dos secciones: carpinter&iacute;a y herrer&iacute;a. Dicho Cuerpo efectuaba actividades tales como reparar armas, reparar y construir bases para ca&ntilde;ones de batalla, de plaza y carruajes, construir lanzas, sables y espadas, almacenar p&oacute;lvora y mantener en dep&oacute;sito el material de artiller&iacute;a fuera de servicio.</p>\r\n<p>Durante las Invasiones Inglesas se destac&oacute; la participaci&oacute;n del Sargento Mayor de Artiller&iacute;a Esteban de Luca, quien con su empe&ntilde;o y creatividad organiz&oacute; los primeros servicios para la fabricaci&oacute;n de ca&ntilde;ones y fusiles. Al mismo tiempo que Domingo Matheu se encontraba instalando la primera f&aacute;brica de p&oacute;lvora y municiones.</p>\r\n<p>A partir del 2 de septiembre de 1810 se concluy&oacute; la organizaci&oacute;n de la f&aacute;brica de fusiles esta vez a cargo de Matheu. En 1811 se estableci&oacute; una f&aacute;brica de fusiles en Tucum&aacute;n bajo la Direcci&oacute;n de Clemente Zavaleta y una f&aacute;brica de p&oacute;lvora en C&oacute;rdoba.</p>\r\n<p>En 1812 el gobierno central encar&oacute; la producci&oacute;n de piezas de artiller&iacute;a y para ello se design&oacute; a D Angel Monasterio y al Bar&oacute;n de Holmberg, al mando de una f&aacute;brica instalada en Jujuy.</p>\r\n<p>A la hora de la emancipaci&oacute;n americana, la futura especialidad de arsenales se hizo presente con su esfuerzo silencioso y fecundo cuando, el General San Mart&iacute;n a fin de solucionar el problema de abastecimiento del Ej&eacute;rcito de los Andes, nombr&oacute; a Fray Luis Beltr&aacute;n a cargo de la maestranza y laboratorio del Estado de Mendoza, debiendo cumplir con la misi&oacute;n de forjar las armas que llevaron por Am&eacute;rica el grito de libertad.</p>\r\n<p>El 19 de enero de 1816, el ya Capit&aacute;n Esteban de Luca fue designado Director de la F&aacute;brica de Fusiles, donde se obten&iacute;a igual calidad que en la experimentadas f&aacute;bricas europeas.</p>\r\n<p>La totalidad de los establecimientos que configuraban el Servicio de Arsenales, en la medida en que pudieron subsistir, fueron reunidos en 1817, bajo un mando com&uacute;n, pasando a depender de lo que posteriormente ser&iacute;a la Inspecci&oacute;n General del Ej&eacute;rcito.</p>\r\n<p>A trav&eacute;s de un decreto del 24 de septiembre de 1822 se dispuso marcar el armamento con la inscripci&oacute;n de Buenos Aires, penando con arresto y pago del valor del arma al que la perdiese, aumentando dicha pena para aquel que comercializara con ellas.</p>\r\n<p>En 1827, tambi&eacute;n por decreto se cre&oacute; la maestranza de artiller&iacute;a en la cual se capacitaban los oficiales en tres ramas: carpinter&iacute;a, armer&iacute;a y mixta (dedicada a la fabricaci&oacute;n de munici&oacute;n).</p>\r\n<p>Durante la presidencia de Julio A. Roca, su ministro de Guerra, General Victorica, dispuso la constituci&oacute;n del \"Arsenal de Guerra\", que fue el primer elemento de Arsenales org&aacute;nico del Ej&eacute;rcito producto de un plan preconcebido y estudiado. La tarea fue encomendada al Coronel Domingo Viejobueno, y para su asentamiento se construy&oacute; un edificio en el predio ubicado entre las calles Combate de los Pozos, Pichincha, Caseros y Garay.</p>\r\n<p>Posterioriormente, en 1885 con el nombre de Arsenal Principal de Guerra se cre&oacute; el actual Batall&oacute;n de Arsenales 601, en 1863 se cre&oacute; la Direcci&oacute;n General de Materiales y en 1897 la Direcci&oacute;n General de Arsenales de Guerra, cuya finalidad era coordinar la actividad de todos los talleres y f&aacute;bricas; su primer Director fue el Cnl D Pablo Riccheri.</p>\r\n<p>Dada la cantidad de materiales, la diversidad de procesos de fabricaci&oacute;n y la necesidad de abastecer racionalmente a las Unidades, y para cumplir con dicha finalidad, se cre&oacute; la Escuela de Operarios Militares, a fin de dotar con personal id&oacute;neo a los Arsenales y Talleres del Ej&eacute;rcito.</p>\r\n<p>En 1921 se cre&oacute; el Batall&oacute;n de Arsenales como dependencia de la Direcci&oacute;n General de Materiales del Ej&eacute;rcito (DGME) y entre los a&ntilde;os 1943 y 1954 se crean talleres en distintos puntos del pa&iacute;s para lograr un eficiente apoyo zonal.</p>\r\n<p>En 1964, como consecuencia de las modificaciones operadas en la organizaci&oacute;n del Ej&eacute;rcito, la Direcci&oacute;n General de Materiales del Ej&eacute;rcito se transform&oacute; en el Comando de Arsenales.</p>\r\n<p>Por ley 19.101 del a&ntilde;o 1971, el Presidente de la Naci&oacute;n decret&oacute; la creaci&oacute;n del Escalaf&oacute;n \"Servicio de Arsenales\" en la categor&iacute;a Personal Superior dentro del Cuerpo Profesional, a partir del 01 de enero de 1972, expresando que: \"...razones org&aacute;nicas determinaron la conveniencia de contar con Personal Superior especializado en Arsenales, a fin de que las funciones t&iacute;picas del mismo, sean cumplidas por personal especialmente reclutado y capacitado a tal fin; que la experiencia aconseja que dicho personal se forme en el Comando de Institutos Militares, mediante su reclutamiento por el Colegio Militar de la Naci&oacute;n\", egresando de esa casa de estudios, a partir de 1976 los Oficiales de Arsenales.</p>\r\n<p>El esp&iacute;ritu que los anima qued&oacute; demostrado durante la Guerra de Malvinas, donde superando obst&aacute;culos, apoyaron a las tropas permiti&eacute;ndoles mantener su capacidad y potencia de fuego.</p>\r\n<p>Desde 1987 bajo la denominaci&oacute;n de \"Direcci&oacute;n de Arsenales\", la especialidad adquiere la organizaci&oacute;n actual.</p>\r\n<p>Hoy, numerosos son los Arsenaleros que, formando parte de las misiones en la Organizaci&oacute;n de las Naciones Unidas, participan en la importante tarea de mantener la paz en el mundo.</p>\r\n<p>La evoluci&oacute;n org&aacute;nica y tecnol&oacute;gica ha dado a esta Especialidad singular importancia por lo que sus miembros forman parte del Cuerpo de Comando del Ej&eacute;rcito.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"\" width=\"401\" height=\"557\"></p>', 6, '2025-11-11 12:28:09', 1, '2025-11-20 20:53:24');
