(13, 'ORACIÓN DEL SOLDADO', 'General', 'aviso_1763671812_691f7f04bd46a.png', '<h1 class=\"ql-align-center\"><strong style=\"background-color: white; color: #050505;\">ORACI&Oacute;N DEL SOLDADO ARGENTINO</strong></h1>\r\n<p class=\"ql-align-center\">&nbsp;</p>\r\n<h2 class=\"ql-align-justify\"><span style=\"background-color: white; color: #050505;\">Se&ntilde;or esc&uacute;chame tanto en la lucha como en la paz. Haz, oh Se&ntilde;or, que mi alma no vacile en el combate.</span></h2>\r\n<h2 class=\"ql-align-justify\"><span style=\"background-color: white; color: #050505;\">Pon destreza en mis manos para que mi tiro sea certero y pon caridad en mi coraz&oacute;n para que mi tiro sea sin odio.</span></h2>\r\n<h2 class=\"ql-align-justify\"><span style=\"background-color: white; color: #050505;\">Pon la guardia mas dura en mi camino y el puesto m&aacute;s dif&iacute;cil en mi avance... y en la paz, te pido lo que muy pocos te deben pedir, inseguridad, sacrificio y dolor para fortalecerme....pero permanentemente te pido Se&ntilde;or, que me ayudes a vivir, y si fuera necesario por D&iacute;os, por la Patria y por la Familia, a morir como un soldado!!!</span></h2>\r\n<p class=\"ql-align-justify\">&nbsp;</p>\r\n<p class=\"ql-align-justify\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\"></p>\r\n<p>&nbsp;</p>', 6, '2025-11-11 15:52:07', 1, '2025-11-20 20:50:14');
INSERT INTO `avisos` (`id_aviso`, `titulo`, `categoria`, `imagen_destacada`, `contenido`, `id_creador`, `fecha_publicacion`, `es_activo`, `fecha_actualizacion`) VALUES
(14, '14 de noviembre: Día de la Inteligencia Militar', 'General', 'aviso_1763671515_691f7ddbee517.png', '<h1><em style=\"background-color: #ffffff; color: #141414;\"><img src=\"data:image/png;base64,\" alt=\"\" width=\"100%\" height=\"500\"></em></h1>\r\n<h1><em style=\"background-color: #ffffff; color: #141414;\">La especialidad comenz&oacute; en el Plan Continental del General San Mart&iacute;n, a trav&eacute;s de la figura del Sargento Mayor Jos&eacute; &Aacute;lvarez de Condarco; fue el encomendado a reconocer los pasos de Los Patos y de Uspallata, por los cuales San Mart&iacute;n y nuestros granaderos realizaron el Cruce de los Andes. En el d&iacute;a de su nacimiento, celebramos el D&iacute;a de la Inteligencia Militar.</em></h1>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">Durante el siglo XIX, la inteligencia militar, la llevaban adelante las partidas de descubierta, que pertenec&iacute;an a las armas, principalmente de caballer&iacute;a. Su objetivo era conocer el enemigo, el terreno y las condiciones meteorol&oacute;gicas.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">Fue con la reorganizaci&oacute;n de los Estados Mayores a fines del siglo XIX, que la informaci&oacute;n militar se consider&oacute; una especialidad por derecho propio, convirti&eacute;ndose en una funci&oacute;n diferenciada. El coronel Richieri, en el cargo de ministro de guerra, tuvo la gran responsabilidad de reorganizar y profesionalizar el Estado Mayor General del Ej&eacute;rcito (EMGE), y puso en cabeza del teniente coronel Carlos R&eacute;gulo Sarmiento la jefatura del reci&eacute;n creado Servicio de Informaciones del Ej&eacute;rcito, el 30 de diciembre de 1900.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">Los conflictos mundiales del siglo XX impondr&iacute;an mayores exigencias sobre los instrumentos militares; en nuestra Fuerza, hubo un crecimiento org&aacute;nico de la especialidad y la incorporaci&oacute;n de conocimientos mediante un sistema de formaci&oacute;n diferenciado. La primera expresi&oacute;n de capacitaci&oacute;n particular fue en 1933, cuando se realiz&oacute; la preparaci&oacute;n y organizaci&oacute;n del Servicio de Criptograf&iacute;a de Guerra, adscripto al Servicio de Informaciones, adem&aacute;s de otros cursillos.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">En 1942, se concluy&oacute; que se precisaba una formaci&oacute;n sistem&aacute;tica de oficiales en &ldquo;trabajos referentes a informaciones como colaboradores en los &oacute;rganos de informaci&oacute;n de los Comandos Superiores&rdquo; y de suboficiales como sus auxiliares t&eacute;cnicos. Para ello, se cre&oacute; la Escuela de Informaciones del Ej&eacute;rcito, cuya puesta en marcha y jefatura recay&oacute; en el coronel Adolfo Carlos Camilo Udry.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">En 1957, la Escuela pas&oacute; a llamarse Escuela Superior de Informaciones del Ej&eacute;rcito, y se les otorg&oacute; a los oficiales egresados el emblema circular dorado con fondo azul de la especialidad, similares a los emblemas otorgados por la Escuela Superior de Guerra y la Escuela Superior T&eacute;cnica. El 21 de septiembre, se crea la publicaci&oacute;n \"Manual de Informaciones\", con el objetivo de difundir conocimientos espec&iacute;ficos de utilidad para el personal de la fuerza.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">En la d&eacute;cada del 1960, el mundo se hab&iacute;a vuelto mucho m&aacute;s complejo, vol&aacute;til, ambiguo e incierto; los Estados precisaban que los servicios de informaciones ampliaran su campo de acci&oacute;n elaborando apreciaciones de inteligencia para colaborar en la formulaci&oacute;n de la estrategia nacional. Se reformularon objetivos y procedimientos con el objetivo de transformar la informaci&oacute;n en inteligencia estrat&eacute;gica. Esta nueva misi&oacute;n trajo el cambio de denominaci&oacute;n del &aacute;rea de Informaci&oacute;n a Inteligencia.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">Luego de la guerra de Malvinas, se producen otros cambios de trascendencia. Por un lado, la tendencia hacia la conjuntez en la planificaci&oacute;n y direcci&oacute;n de las operaciones militares. Por otro lado, la revoluci&oacute;n de los asuntos militares modifica el campo de batalla.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">En el a&ntilde;o 2000, la acci&oacute;n conjunta llev&oacute; a la fusi&oacute;n de las escuelas de inteligencia de las tres fuerzas en el Instituto de Inteligencia de las Fuerzas Armadas &ldquo;Sargento Mayor Don Jos&eacute; Antonio &Aacute;lvarez de Condarco&rdquo;, mediante una Resoluci&oacute;n del Ministerio de Defensa.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">La revoluci&oacute;n de los asuntos militares introdujo el concepto de visibilidad total del campo de combate, guiada por los avances tecnol&oacute;gicos; sensores y medios de comunicaci&oacute;n permiten detectar y transmitir desde lo m&aacute;s profundo del dispositivo enemigo. A partir del a&ntilde;o 2005, esto motiv&oacute; una reconversi&oacute;n del sistema, que lo adecu&oacute; a las nuevas necesidades normativas y funcionales.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">Entre las medidas, se destaca la creaci&oacute;n de elementos de inteligencia de combate, con elementos y doctrina propia. El Destacamento de Inteligencia de Combate y la Secci&oacute;n de Educaci&oacute;n de Inteligencia de Combate de la Escuela de las Armadas, son las entidades formadoras para esta tarea.</span></p>\r\n<p><span style=\"background-color: #ffffff; color: #141414;\">La inteligencia es una actividad que est&aacute; permanentemente en operaciones; en tiempos de paz, para evitar la guerra, y en tiempos de guerra, para ganarla. La Especialidad de Inteligencia del Ej&eacute;rcito Argentino se mantiene fiel al esp&iacute;ritu del Sargento Mayor &Aacute;lvarez de Condarco, y como &eacute;l, sus integrantes est&aacute;n dispuestos a llevar las tareas m&aacute;s arriesgadas, teniendo por mayor recompensa el bien de la Patria.</span></p>\r\n<h1>&nbsp;</h1>', 6, '2025-11-14 10:33:40', 1, '2025-11-20 20:45:15');
