;\">Cabo principal Hugo Dante Cesar Aramayo</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Luis Esteban Garc&iacute;a</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Sergio Antonio Cuellar</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Fernando Gabriel Santilli</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Alberto Ramiro Arjona</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Enrique Dami&aacute;n Castillo</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Luis Carlos Nolasco</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal David Alonso Meli&aacute;n</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Germ&aacute;n Oscar Su&aacute;rez</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Daniel Alejandro Polo</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Leandro Fabi&aacute;n Cisneros</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Luis Alberto Niz</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo principal Federico Alejandro Alcaraz Coria</li>\r\n<li style=\"text-align: left; margin-left: 25px;\">Cabo segundo An&iacute;bal Tolaba</li>\r\n</ol>', 6, '2025-11-15 17:21:31', 1, '2025-11-20 20:43:05');
