(18, '¡Día de la Soberanía Nacional! El Grito de la Vuelta de Obligado', 'Institucional', 'aviso_1763671190_691f7c969035d.jpg', '<p><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"100%\" height=\"200\"></p>\r\n<p>Hoy celebramos una fecha que recuerda que defender la patria no es solo hablar; es luchar con lo que se tiene.</p>\r\n<p><strong>1845: Cuando Argentina Dijo \"&iexcl;NO!\"</strong></p>\r\n<p>Hace casi 180 a&ntilde;os, las dos potencias navales m&aacute;s grandes del mundo, <strong>Francia e Inglaterra,</strong> intentaron entrar por la fuerza a nuestros r&iacute;os. Quer&iacute;an comerciar sin permiso y desafiar nuestra autoridad.</p>\r\n<p>El l&iacute;der de la Confederaci&oacute;n, <strong>Juan Manuel de Rosas</strong>, se neg&oacute; rotundamente a ceder un cent&iacute;metro de soberan&iacute;a.</p>\r\n<h3>La Batalla Imposible</h3>\r\n<p>El escenario fue un codo estrecho del R&iacute;o Paran&aacute;, conocido como la Vuelta de Obligado.</p>\r\n<p>El plan argentino fue &eacute;pico: Bloquear el r&iacute;o con tres gruesas cadenas de hierro sostenidas por viejos barcos, <strong>mientras 2000 patriotas </strong>esperaban en la orilla con ca&ntilde;ones antiguos y fusiles.</p>\r\n<p>La flota extranjera logr&oacute; pasar, y la batalla cost&oacute; barcos y vidas. Sin embargo, la resistencia fue la verdadera victoria. La ferocidad del combate y el alt&iacute;simo costo de cruzar demostraron a los invasores que <span style=\"background-color: #fbeeb8;\"><strong>ARGENTINA JAM&Aacute;S SE RENDIRIA</strong></span>. Fue una victoria moral que forz&oacute; a Francia e Inglaterra a reconocer, a&ntilde;os despu&eacute;s, la Soberan&iacute;a de Argentina sobre sus propios r&iacute;os.</p>\r\n<p>&iexcl;Un pu&ntilde;ado de argentinos con cadenas se par&oacute; frente a la arrogancia mundial y gan&oacute; el respeto de la historia!</p>\r\n<p>🔥 <strong>Recuerden</strong>: <strong><span style=\"background-color: #c2e0f4;\">La soberan&iacute;a no es solo un territorio; es el derecho irrenunciable a decidir qui&eacute;n entra y qui&eacute;n no a nuestra casa</span></strong></p>', 15, '2025-11-20 14:49:40', 1, '2025-11-21 12:35:44');
